INSERT INTO `t_demand_track` VALUES ('34', '25', '01_001_20180817', null, '张静静', '2018-08-15', '王林柱', null, '1', '100%', '2.7.0', 'USER005', '代办任务提醒', '<p>根据用户角色提供给操作人员的任务提示信息</p><p>每个流程根据流程流转的状态和当前的操作人员，插入一个任务列表中，到时候每个登录的人员能够在这个列表中获取相关的代办的任务信息</p>', '4', '2018-09-12', '2018-09-19', null, '2018-09-27', null, '2', '10', '0', '0', '2018-09-05 00:00:00', '', '2018-09-14 09:59:08', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('35', '25', '40_001_20180817', null, '李刘娟', '2018-08-22', '张静静', null, '1', '100%', '2.7.0', 'USER002', '投配流程四期优化', '<p>1、增加投配变更业务类型</p><p>完成退款的的划款和金额、份额的确认</p><p>2、馈，节点上上传多个文件</p><p>3、指令完成后，在指令的上上传补充的文件和合同内容</p>', '4', '2018-09-12', '2018-09-19', null, '2018-09-27', null, '1', '5', '0', '0', '2018-09-05 00:00:00', '', '2018-09-14 09:55:46', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('36', '25', '20180905-001', null, '张静静', '2018-09-05', '张静静', null, '1', '100%', '2.7.0', 'USER005', '保障金缴纳的提醒功能（优化）', '<p>某账户成立后未进行投资，结果保障金进行了缴纳，与高雪讨论后觉得可以设定为2个月未进行投资，先行不缴纳</p><p>1、增加成立日期&nbsp; 数据列</p><p>2.增加持有资产总投资本金（元）&nbsp; 数据列</p>', '4', '2018-09-12', '2018-09-19', null, '2018-09-27', null, '0', '4', '0', '0', '2018-09-05 00:00:00', '', '2018-09-07 17:19:43', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('37', '25', '50_001_20180820', null, '李刘娟', '2018-08-20', '张静静', null, '1', '100%', '2.7.0', 'USER002', '财产追加赎回、分配净值信息展示', '<p>1、当有追加赎回、净值分配业务操作时，取出TA中的确认日期前一日的净值信息</p><p>在指令申请及审批页面中，有一个地方显示这个业务确认的净值日期和净值信息</p>', '4', '2018-09-12', '2018-09-19', null, '2018-09-27', null, '1', '1', '0', '0', '2018-09-05 00:00:00', '', '2018-09-14 09:59:35', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('38', '25', '60_006_20180906', null, '张静静', '2018-09-05', '张静静', null, '1', '100%', '2.7.0', 'USER004', '银行账户余额&流水对接（优化）', '<p>增加门户端功能</p><p>增加数据权限功能</p><p>优化数据同步机制功能：</p><p>1、余额明天早上同步数据、中午12点同步数据</p><p>2、流水明细每天早上同步数据、中午12点同步数据</p>', '4', '2018-09-12', '2018-09-19', null, '2018-09-27', null, '1', '3', '0', '0', '2018-09-05 16:18:37', null, '2018-09-14 09:54:54', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('39', '25', '60_005_20180814', null, '张龙', '2018-08-29', '张静静', null, '1', '100%', '2.7.0', 'USER002', '退款管理需求', '<p>1、针对家族信托专户收到莫名其妙的一笔入账</p><p>2、会计首先完成账务的处理，将这笔帐挂在一个科目下</p><p>3、家族由运营管理部在oa尚发起审批流程</p><p>4、在家族平台上完成拨款的动作，A岗发起申请、B岗复核、到CC划款</p>', '4', '2018-09-19', '2018-09-19', null, '2018-09-27', null, '0', '6', '0', '0', '2018-09-05 16:19:36', null, '2018-09-14 09:53:29', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('40', '25', '60_006_20180906', null, '李刘娟', '2018-09-05', '张静静', null, '1', '100%', '2.7.0', 'USER004', '银行流水信息查询', '<p>所有专户账户流水信息查询。</p><p>银行流水信息按照项目，专户。流水信息为维度的一个信息查询</p><p>根据同一天的流水信息，排除产品赎回、转让业务、排除项目追加业务，根据分配清算提示信息，模糊匹配出可能发生分配的产品列表</p>', '4', '2018-09-14', '2018-09-19', null, '2018-09-27', null, '1', '3.5', '0', '0', '2018-09-05 00:00:00', '', '2018-09-14 09:45:05', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('41', '25', '92_002_20180821', null, '张静静', '2018-09-05', '王林柱', null, '1', '100%', '2.7.0', 'USER003', '自动任务管理', '<p>后台每一个自动任务的信息列表和运行情况的展示，并且能够从页面调起自动任务</p>', '4', '2018-09-05', '2018-09-19', null, '2018-09-27', null, '0', '10', '0', '0', '2018-09-05 00:00:00', '', '2018-09-07 17:19:57', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('42', '25', '92_005_20180822', '', '张静静', '2018-08-22', '王林柱', null, '1', '100%', '2.7.0', 'USER004', '通知消息管理', '<p>展示通知（目前是邮件通知）消息的信息及状态，以及重新发送邮件</p>', '4', '2018-09-12', '2018-09-19', null, '2018-09-27', null, '2', '13.5', '1', '1', '2018-09-14 09:34:51', null, '2018-10-10 19:39:37', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('43', '25', '70_001_20180905', null, '李刘娟', '2018-09-05', '张静静', null, '1', '100%', '2.7.0', 'USER002', '与TA和FA数据核对', '<p>分别将家族信托系统的持有份额数据与TA系统和FA系统进行对比。</p>', '4', '2018-09-19', '2018-09-19', null, '2018-09-27', null, '0', '2', '0', '0', '2018-09-14 08:45:39', null, null, null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('44', '25', '60_003_20180906', '', '张静静', '2018-09-06', '张静静', null, '1', '100%', '2.7.0', 'USER004', '专户余额及明细', '本次将所有项目账户的流水全部展示，后期将银行流水与业务流水进行模糊匹配。', '4', '2018-09-18', '2018-09-19', null, '2018-09-27', null, '0', '1.5', '0', '0', '2018-09-14 08:49:04', null, '2018-10-10 19:49:05', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('47', '25', '90-001-20180926', '', '李刘娟', '2018-09-26', '张静静', null, '1', '10%', '2.8.0', 'USER002', '财产追加、赎回、分配净值日期取确认日期前一天工作日', '', '1', '2018-09-27', '2018-10-23', null, '2018-11-01', null, '1', '1', '0', '0', '2018-09-26 11:33:26', null, '2018-10-10 18:29:27', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('48', '25', '90-002-20180926', '', '张静静', '2018-09-26', '王林柱', null, '1', '70%', '2.8.0', 'USER004', '家族信托提供工作日历查询', '<p>1、获取实际节假日情况存放数据库</p><p>2、查询当天情况是否工作日</p>', '2', '2018-09-27', '2018-10-24', null, '2018-11-01', null, '2', '3', '0', '0', '2018-09-26 11:35:33', null, '2018-10-10 19:39:10', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('49', '25', '30_001_20181008_01', '运营', '赵龙', '2018-10-08', '张静静', null, '1', null, '2.8.0', 'USER002', '产品信息报表导出', '<p>1、管理端及门户端产品信息报表导出</p>', '2', null, '2018-10-16', null, '2018-11-01', null, '0', '2.5', '1', '0', '2018-10-10 20:23:58', null, '2018-10-10 20:24:18', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('50', '25', '50_004_20181008', '运营', '赵龙', '2018-10-08', '张静静', null, '1', null, '2.8.0', 'USER002', '财产分配申请及审批（清算分配场景）', '<p>1.<span>	</span>管理端及门户端增加清算分配的分配业务场景</p><p>a、<span>	</span>新增分配类型-清算分配</p><p>b、<span>	</span>所有页面隐藏掉申请人、申请人类型。</p><p>c、<span>	</span>将分配类型提到前面输入，如果是清算分配业务类型，分配金额不可编辑</p><p>d、<span>	</span>如果是清算分配，则由运营审核时输入分配金额-运营管理A岗</p><div><br></div>', '2', null, '2018-10-24', null, '2018-11-01', null, '0', '1', '0', '0', '2018-10-10 20:29:10', null, '2018-10-10 20:29:29', null, '', '', '');
INSERT INTO `t_demand_track` VALUES ('51', '25', '50_001_20180918', '理财师', '希圣骑', '2018-09-18', '张静静', null, '1', null, '2.8.0', 'USER002', '财产追加功能优化支持多种资产类型打包提交', '<p>1.新增信托财产明细表t_capital_detail</p><p>2.管理端及门户端修改财产追加指令新增及保存功能</p><p>3.管理端修改推送TA的金额用多笔资产的汇总金额</p><p>4.管理端修改财产追加指令确认存储过程（持有资产表及历史确认表存入产品受益级别）</p><p>5.管理端及门户端信托财产交易明细中，需要去掉sql和页面上的资产类型和资产名称</p>', '1', null, '2018-10-24', null, '2018-11-01', null, '1', '6', '1', '0', '2018-10-10 20:34:54', null, null, null, '', '', '');
